INSERT INTO `r_step_attribute` VALUES ('1953', '15', '80', '0', 'sql', '0', 'SELECT cr.appraisal_type_id,org.parent_org_id,org.parent_level_id,cr.cds_id,cr.`year`,cr.appraisal_month_no,cr.appraisal_month_name,sum(cr.cds_value) as cds_value,\r\nLAST_DAY(CONCAT(cr.`year`,\"-\",(cr.appraisal_month_no),\"-01\")) as etl_dttm\r\nFROM\r\n	(select o.org_id as parent_org_id,o.level_id as parent_level_id,op.org_id,op.level_id\r\n	FROM \r\n		(SELECT\r\n		op.org_id,\r\n		op.org_code,\r\n		op.org_name,\r\n		op.parent_org_code,\r\n		op.level_id\r\n		FROM org AS op\r\n		WHERE\r\n		op.parent_org_code IS NOT NULL AND\r\n		op.level_id IS NOT NULL) op \r\n	INNER JOIN org o on op.parent_org_code = o.org_code\r\n	WHERE\r\n	o.level_id IS NOT NULL\r\n	-- and op.level_id = 7)org\r\n	and op.level_id = ${param_level_id})org\r\nINNER JOIN cds_result AS cr ON cr.org_id = org.org_id AND cr.level_id = org.level_id\r\nWHERE \r\n-- org.org_id  = 454 and \r\ncr.cds_id in (22,26) \r\nand cr.`year` = (select current_appraisal_year from system_config)\r\nGROUP BY\r\ncr.appraisal_type_id,org.parent_org_id,org.parent_level_id,cr.cds_id,cr.`year`,cr.appraisal_month_no,cr.appraisal_month_name\r\nORDER BY 2,4,5,6\r\n\r\n\r\n\r\n\r\n\r\n\r\n');
