INSERT INTO `r_step_attribute` VALUES ('2746', '17', '116', '0', 'jsScript_script', '0', 'var java_percent_achievement = 0;\r\nvar java_score = 0;\r\nvar java_weigh_score = 0;\r\nif( value_type_id == 1){ //Bigger is better\r\n	if(target_value == 0){ \r\n		java_percent_achievement = 0;\r\n	}else{\r\n		java_percent_achievement = (actual_value / target_value) * 100;\r\n	}\r\n}else if( value_type_id == 2){//Smaller is better \r\n	if(target_value == 0){ \r\n		java_percent_achievement = 0;\r\n	}else{\r\n		java_percent_achievement = 100 + (((target_value - actual_value ) / target_value )*100);\r\n	}\r\n}\r\n\r\n\r\n\r\nif(form_id == 1){\r\n// Quantity\r\n	if(actual_value == 0){\r\n		java_score = 0;\r\n	}\r\n	else if(actual_value > score0 && actual_value < score1){\r\n		java_score = 1;\r\n	}\r\n	else if(actual_value >= score1 && actual_value < score2){\r\n		java_score = 2;\r\n	}else if(actual_value >= score2 && actual_value < score3){\r\n		java_score = 3;\r\n	}else if(actual_value >= score3 && actual_value < score4){\r\n		java_score = 4;\r\n	}else if(actual_value >= score4 && actual_value < score5){\r\n		java_score = 5;\r\n	}else if(actual_value >= score5){\r\n		java_score = 5;\r\n	}else{\r\n		java_score = 0;\r\n	}\r\n\r\n	java_weigh_score = (java_score * weight_percent)/100;\r\n}//else if(form_id == 2){\r\n// Quality\r\n//	java_score = score;\r\n//	java_weigh_score = (java_score * weight_percent);\r\n\r\n//}else if(form_id == 3){\r\n// Deduct\r\n//	java_over_value = max_value-actual_value;\r\n//	java_weigh_score = (java_over_value * deduct_score_unit);\r\n	\r\n//}\r\n\r\n\r\n\r\n\r\n\r\n\r\n');
