INSERT INTO `r_step_attribute` VALUES ('3501', '19', '143', '0', 'sql', '0', 'SELECT item_result_id\r\n,over_value\r\n,(over_value * deduct_score_unit) as weigh_score\r\nFROM(\r\nSELECT ir.item_result_id,\r\ncase when ir.max_value - ir.actual_value > 0 then 0 else ir.max_value - ir.actual_value end as over_value,\r\ndeduct_score_unit\r\nFROM appraisal_item_result ir\r\ninner join appraisal_item i on ir.item_id = i.item_id\r\ninner join appraisal_structure s on s.structure_id = i.structure_id\r\ninner join form_type fy on fy.form_id = s.form_id\r\ninner join appraisal_period ap on  ap.period_id  = ir.period_id \r\nwhere fy.form_id = 3\r\nand ir.actual_value is not null\r\nand ir.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	-- where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n    -- and ap.appraisal_year = (select current_appraisal_year from system_config)\r\n)\r\n)Deduct');
