INSERT INTO `r_step_attribute` VALUES ('3812', '21', '158', '0', 'sql', '0', 'SELECT \r\nemp_result_id\r\n,structure_id\r\n,period_id\r\n,level_id\r\n,org_id\r\n,emp_id\r\n,position_id\r\n,sum(weigh_score) as weight_score_sum_detail\r\n,nof_target_score\r\n,CASE WHEN unlimit = 1 and MAX(check_SVGZ) = 1\r\n			THEN 0\r\n			ELSE weight_percent\r\n			END as weight_percent_deduct_score\r\n,CASE WHEN unlimit = 0 and MAX(check_SVGZ) = 1 THEN 0\r\n			WHEN sum(weigh_score) = 0 THEN (CASE WHEN unlimit = 1 and MAX(check_SVGZ) = 1 THEN 0 ELSE weight_percent END)\r\n			WHEN unlimit = 0 and (CASE WHEN unlimit = 1 and MAX(check_SVGZ) = 1 THEN 0 ELSE weight_percent END) + (sum(weigh_score)) < 0 THEN 0\r\n			WHEN unlimit = 1 and (CASE WHEN unlimit = 1 and MAX(check_SVGZ) = 1 THEN 0 ELSE weight_percent END) + (sum(weigh_score)) < 0 THEN (CASE WHEN unlimit = 1 and MAX(check_SVGZ) = 1 THEN 0 ELSE weight_percent END) + (sum(weigh_score))\r\n			ELSE (CASE WHEN unlimit = 1 and MAX(check_SVGZ) = 1 THEN 0 ELSE weight_percent END) + (sum(weigh_score))\r\n			END as weigh_score\r\nFROM (\r\n			SELECT er.emp_result_id \r\n			,ai.structure_id\r\n			,er.period_id\r\n			,er.level_id\r\n			,er.org_id\r\n			,er.emp_id\r\n			,er.position_id\r\n			,astr.is_unlimited_deduction as unlimit\r\n			,air.actual_value\r\n			,air.value_get_zero\r\n			,CASE WHEN astr.is_unlimited_deduction = 1 \r\n						THEN \r\n									CASE WHEN air.value_get_zero IS NULL THEN air.weigh_score\r\n											 WHEN air.actual_value >= air.value_get_zero THEN 0\r\n											 ELSE air.weigh_score\r\n									END\r\n						ELSE air.weigh_score\r\n			 END as weigh_score\r\n			,0 as nof_target_score\r\n			,ac.weight_percent*4/100 as weight_percent\r\n			,CASE\r\n				WHEN air.actual_value >= air.value_get_zero THEN 1\r\n					ELSE 0\r\n					END as check_SVGZ -- check_value_get_zero\r\n			FROM emp_result er\r\n			inner join appraisal_item_result air on air.emp_result_id = er.emp_result_id\r\n			inner join appraisal_item ai on ai.item_id = air.item_id\r\n			inner join appraisal_structure astr on astr.structure_id = ai.structure_id\r\n			inner join form_type fy on fy.form_id = astr.form_id\r\n			inner join appraisal_criteria ac on ac.structure_id = astr.structure_id \r\n			 and ac.appraisal_level_id = er.level_id\r\n			inner join appraisal_period ap on  ap.period_id  = air.period_id \r\n			where fy.form_id = 3\r\n			and er.period_id in (\r\n					SELECT ap.period_id\r\n					FROM appraisal_period ap\r\n					where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n					and ap.appraisal_year = (select current_appraisal_year from system_config))\r\n			and status = \'accepted\') sr\r\ngroup by structure_id\r\n,period_id\r\n,level_id\r\n,org_id\r\n,emp_id\r\n,position_id\r\n\r\n\r\n\r\n/*SELECT ai.structure_id\r\n,er.period_id\r\n,er.level_id\r\n,er.org_id\r\n,er.emp_id\r\n,er.position_id\r\n,sum(air.weigh_score) as weight_score_sum_detail\r\n,0 as nof_target_score\r\n,ac.weight_percent*4/100 as weight_percent_deduct_score\r\n-- ,sum(air.weigh_score)-(ac.weight_percent) as weigh_score\r\n,CASE\r\n	WHEN sum(air.weigh_score) = 0 THEN (ac.weight_percent)*4/100\r\n	WHEN ((ac.weight_percent)*4/100) + (sum(air.weigh_score)) < 0 THEN 0\r\n    ELSE ((ac.weight_percent)*4/100) + (sum(air.weigh_score))\r\n    END as weigh_score\r\n-- ,(ac.weight_percent*(SELECT max_score FROM system_config)/100) + sum(air.weigh_score) as weigh_score\r\nFROM emp_result er\r\ninner join appraisal_item_result air on air.emp_result_id = er.emp_result_id\r\ninner join appraisal_item ai on ai.item_id = air.item_id\r\ninner join appraisal_structure astr on astr.structure_id = ai.structure_id\r\ninner join form_type fy on fy.form_id = astr.form_id\r\ninner join appraisal_criteria ac on ac.structure_id = astr.structure_id \r\nand ac.appraisal_level_id = er.level_id\r\ninner join appraisal_period ap on  ap.period_id  = air.period_id \r\nwhere fy.form_id = 3\r\nand status = \'accepted\'\r\nand er.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	where -- ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n	-- and \r\n    ap.appraisal_year = (select current_appraisal_year from system_config)\r\n)\r\ngroup by ai.structure_id\r\n,er.period_id\r\n,er.level_id\r\n,er.org_id\r\n,er.emp_id\r\n,er.position_id */\r\n/* \r\nSELECT\r\nsr.period_id,\r\ne.level_id,\r\ne.org_id,\r\nsr.emp_id,\r\ne.position_id,\r\nSum(sr.weigh_score) AS result_score\r\nFROM\r\nstructure_result AS sr\r\nINNER JOIN emp_result e on sr.emp_id = e.emp_id\r\nWHERE\r\nsr.period_id IN ((\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	-- where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n    -- and ap.appraisal_year = (select current_appraisal_year from system_config)\r\n))\r\nGROUP BY\r\nsr.period_id,\r\ne.level_id,\r\ne.org_id,\r\nsr.emp_id,\r\ne.position_id\r\n*/');
