INSERT INTO `r_step_attribute` VALUES ('4033', '22', '164', '0', 'sql', '0', 'SELECT er.emp_result_id\r\n, er.period_id\r\n, er.emp_id\r\n, ai.structure_id\r\n, sum(weigh_score) as weight_score_sum_detail\r\n, astr.nof_target_score\r\n, 0 as weight_percent_deduct_score\r\n-- , sum(weigh_score)/astr.nof_target_score as weigh_score\r\n, sum(weigh_score) as weigh_score\r\nFROM emp_result er\r\ninner join appraisal_item_result air on air.emp_result_id = er.emp_result_id\r\ninner join appraisal_item ai on ai.item_id = air.item_id\r\ninner join appraisal_structure astr on astr.structure_id = ai.structure_id\r\ninner join form_type fy on fy.form_id = astr.form_id\r\ninner join appraisal_period ap on  ap.period_id  = air.period_id \r\nwhere fy.form_id != 3\r\nand status = \'accepted\'\r\nand er.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	 where -- ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n	 -- and \r\n	ap.appraisal_year = (select current_appraisal_year from system_config)\r\n)\r\ngroup by er.emp_result_id\r\n, er.period_id\r\n, er.emp_id\r\n, ai.structure_id');
