INSERT INTO `r_step_attribute` VALUES ('4070', '23', '167', '0', 'sql', '0', '/* SELECT structure_result.period_id\r\n,structure_result.level_id\r\n,structure_result.org_id\r\n,structure_result.emp_id\r\n,structure_result.position_id\r\n,sum(structure_result.weigh_score) as result_score\r\nFROM `structure_result`\r\nwhere structure_result.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n)\r\ngroup by structure_result.period_id\r\n,structure_result.level_id\r\n,structure_result.org_id\r\n,structure_result.emp_id\r\n,structure_result.position_id */\r\n/*\r\nSELECT\r\ne.emp_result_id,\r\nsr.period_id,\r\ne.level_id,\r\ne.org_id,\r\nsr.emp_id,\r\ne.position_id,\r\nSum(sr.weigh_score) AS result_score\r\nFROM\r\nstructure_result AS sr\r\nINNER JOIN emp_result e on sr.emp_result_id = e.emp_result_id\r\nWHERE\r\nsr.period_id IN ((\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	-- where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n))\r\n\r\nGROUP BY\r\ne.emp_result_id,\r\nsr.period_id,\r\ne.level_id,\r\ne.org_id,\r\nsr.emp_id,\r\ne.position_id\r\n*/\r\n\r\nSELECT sr.emp_result_id,\r\nsum(sr.weigh_score) as result_score\r\nFROM `structure_result` sr\r\nWHERE\r\nsr.period_id IN (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	-- where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n)\r\nAND sr.emp_result_id IS NOT NUll\r\ngroup by sr.emp_result_id');
