INSERT INTO `r_step_attribute` VALUES ('6274', '35', '275', '0', 'jsScript_script', '0', 'var vstartdate = vstartdate;\nvar FirstDateOfFiscalYear = dateAdd((vstartdate),\"y\",0);//543\nvar FirstDateOfMonth = dateAdd(dateAdd(vstartdate, \"m\", totaldate-1),\"y\",0);//543\nvar LastDateOfMonth = dateAdd(dateAdd( dateAdd(vstartdate, \"m\", totaldate-1+1) ,\"d\",-1),\"y\",0);//543\r\nvar budget_year ;\r\nif(month(FirstDateOfMonth) <= 8){\r\n	budget_year = year(dateAdd((FirstDateOfMonth),\"y\",0));//543\r\n}\r\nelse{\r\n	budget_year = year(dateAdd((FirstDateOfMonth),\"y\",0)) +1;//543\r\n}\n');
