INSERT INTO `r_step_attribute` VALUES ('6277', '35', '275', '1', 'jsScript_script', '0', '// Add\'s the given number to  the given date Value.\n//\n// Usage:\n// dateAdd(var,var,var);\n// 1: Date - The Variable with the Date.\n// 2: String - The Type which represents the value\n// to add.\n// y - Years\n// m - Months\n// d - Days\n// w - Weeks\n// wd - Workingdays\n// hh - Hours\n// mi - Minutes\n// ss - Seconds\n// 3: Numeric - The Value to add.\n// \n// 2006-11-15\n//\nvar d1 = new Date();\nAlert(dateAdd(d1, \"y\", 1));\nAlert(dateAdd(d1, \"m\", 4));\nAlert(dateAdd(d1, \"d\", 5));\nAlert(dateAdd(d1, \"wd\", 5));');
