INSERT INTO `r_step_attribute` VALUES ('9770', '29', '406', '0', 'jsScript_script', '0', 'var selectFunction = [\"sum(cds_value)\",\"max(cds_value)\"]; // default sum\r\nvar selectString = selectFunction[accum_flag];\r\n\r\nvar sqlQuery = \" select \"+selectString+\" as cds_value \"\r\n	+\" from cds_result \"\r\n	+\" where cds_id = \"+cds_id+\" \"\r\n\r\nif(cds_type == \'s\'){\r\n\r\n	var sqlQuery = \"select cast(ifnull(result.cds_value,defaultValue.cds_value) as DECIMAL(12,2)) as cds_value\"\r\n	+\" from (select 0.00 as cds_value) defaultValue left join \"\r\n	+\" (select \"+selectString+\" as cds_value \"\r\n	+\" from cds_result \"\r\n	+\" where cds_id=\"+cds_id+\" \"\r\n	+\" and emp_id=\"+emp_id+\" \"\r\n	+\" and date(concat(cds_result.`year`,\'-\',cds_result.appraisal_month_no,\'-\',01)) >= \'\"+period_start_year+\"\"+\'-\'+\"\"+period_start_month_no+\"\"+\'-01\'+\"\'\"\r\n	+\" and date(concat(cds_result.`year`,\'-\',cds_result.appraisal_month_no,\'-\',01)) <= \'\"+period_end_year+\"\"+\'-\'+\"\"+period_end_month_no+\"\"+\'-01\'+\"\'\"\r\n	+\" ) result on defaultValue.cds_value != result.cds_value\"\r\n\r\n} else if (cds_type == \'a\') {\r\n\r\n	var sqlQuery = \"select cast(ifnull(result.cds_value,defaultValue.cds_value) as DECIMAL(12,2)) as cds_value\"\r\n	+\" from (select 0.00 as cds_value) defaultValue left join \"\r\n	+\" (select avg(cds_value) as cds_value \"\r\n	+\" from cds_result \"\r\n	+\" where cds_id=\"+cds_id+\" \"\r\n	+\" and emp_id=\"+emp_id+\" \"\r\n	+\" and date(concat(cds_result.`year`,\'-\',cds_result.appraisal_month_no,\'-\',01)) >= \'\"+period_start_year+\"\"+\'-\'+\"\"+period_start_month_no+\"\"+\'-01\'+\"\'\"\r\n	+\" and date(concat(cds_result.`year`,\'-\',cds_result.appraisal_month_no,\'-\',01)) <= \'\"+period_end_year+\"\"+\'-\'+\"\"+period_end_month_no+\"\"+\'-01\'+\"\'\"\r\n	+\" ) result on defaultValue.cds_value != result.cds_value\"\r\n\r\n}else{\r\n\r\n	var sqlQuery = \"select cast(ifnull(result.cds_value,defaultValue.cds_value) as DECIMAL(12,2)) as cds_value\"\r\n	+\" from (select 0.00 as cds_value) defaultValue left join \"\r\n	+\" (select \"+selectString+\" as cds_value \"\r\n	+\" from cds_result \"\r\n	+\" where cds_id=\"+cds_id+\" \"\r\n	+\" and emp_id=\"+emp_id+\" \"\r\n	+\" and cds_result.`year`=\"+period_start_year+\" \"\r\n	+\" and cds_result.appraisal_month_no = ( \"\r\n	+\" select max(appraisal_month_no) \"\r\n	+\" from cds_result \"\r\n	+\" where cds_id=\"+cds_id+\" \"\r\n	+\" and emp_id=\"+emp_id+\" \"\r\n	+\" and cds_result.`year`=\"+period_start_year+\" \"\r\n	+\" and cds_value != 0  \"\r\n	+\" )\"\r\n	+\" ) result on defaultValue.cds_value != result.cds_value\"\r\n\r\n}\r\n\r\n/*	\" and ( case when year(\\\"\"+start_date+\"\\\") < year( \\\"\"+end_date+\"\\\")\"\r\n	+\" then ((appraisal_month_no BETWEEN month(\\\"\"+start_date+\"\\\") and 12) or (appraisal_month_no BETWEEN 1 AND month(\\\"\"+end_date+\"\\\")) ) \"\r\n	+\" else (appraisal_month_no BETWEEN month(\\\"\"+start_date+\"\\\") and month(\\\"\"+end_date+\"\\\") ) end)\"*/');
