INSERT INTO `r_step_attribute` VALUES ('9816', '29', '408', '0', 'sql', '0', 'SELECT air.item_result_id,\r\nal.no_weight as flag_no_weight,\r\n(SELECT system_config.threshold FROM system_config) as flag_threshold,\r\ner.appraisal_type_id,\r\nair.item_id,\r\nastr.form_id,\r\nkcm.cds_id,\r\nair.emp_id,\r\nair.org_id,\r\nair.period_id,\r\nREPLACE(ai.formula_cds_id, \'last\', \'sum\') as formula_cds_id,\r\n0 as accum_flag,\r\nap.appraisal_year,\r\nair.score0,\r\nair.score1,\r\nair.score2,\r\nair.score3,\r\nair.score4,\r\nair.score5,\r\nair.score,\r\nai.value_type_id,\r\nmonth(ap.start_date) as start_month_no,\r\nmonth(ap.end_date) as end_month_no,\r\n-- air.actual_value as actual_value_new,\r\nair.target_value,\r\nair.weight_percent,\r\nSUBSTR(ai.formula_cds_id,2,1) as cds_type\r\nFROM appraisal_item_result air\r\nINNER JOIN emp_result er on er.emp_result_id = air.emp_result_id\r\ninner join appraisal_item ai on ai.item_id = air.item_id\r\ninner join appraisal_item_level ail on ail.item_id = ai.item_id\r\ninner join appraisal_level al on al.level_id = ail.level_id\r\ninner join appraisal_structure astr on astr.structure_id = ai.structure_id\r\ninner join kpi_cds_mapping kcm on kcm.item_id = ai.item_id\r\ninner join appraisal_period ap on ap.period_id = air.period_id\r\nwhere air.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_start_date}\'\r\n	and ap.appraisal_year = (select current_appraisal_year from system_config)\r\n)\r\nand astr.form_id = 1\r\n-- and air.item_result_id = 732\r\ngroup by air.item_result_id,\r\nal.no_weight,\r\n(SELECT system_config.threshold FROM system_config),\r\ner.appraisal_type_id,\r\nair.item_id,\r\nkcm.cds_id,\r\nair.emp_id,\r\nair.org_id,\r\nair.period_id,\r\nREPLACE(ai.formula_cds_id, \'last\', \'sum\'),\r\nap.appraisal_year,\r\nair.score0,\r\nair.score1,\r\nair.score2,\r\nair.score3,\r\nair.score4,\r\nair.score5,\r\nai.value_type_id,\r\nmonth(ap.start_date),\r\nmonth(ap.end_date),\r\nair.target_value,\r\nair.weight_percent,\r\nSUBSTR(ai.formula_cds_id,2,1)');
