INSERT INTO `r_step_attribute` VALUES ('10636', '13', '459', '0', 'sql', '0', 'SELECT kcm.cds_id,\r\nempr.appraisal_type_id,\r\nair.org_id,\r\nair.level_id,\r\nair.emp_id,\r\nair.position_id,\r\nemp.emp_code\r\nFROM appraisal_item_result air\r\ninner join appraisal_item ai on ai.item_id = air.item_id\r\ninner join kpi_cds_mapping kcm on kcm.item_id = ai.item_id\r\ninner join employee emp on emp.emp_id = air.emp_id\r\ninner join emp_result empr on empr.emp_result_id = air.emp_result_id\r\nwhere air.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	where ap.start_date <= now() and ap.end_date >= now()\r\n)\r\nand kcm.cds_id = ${sql_cds_id}\r\norder by emp.emp_code');
