INSERT INTO `r_step_attribute` VALUES ('10835', '13', '469', '0', 'sql', '0', 'SELECT current_appraisal_year as period_year\r\n,case \r\n		when period_start_month_id = 1 then month_id\r\n		when month_id >= period_start_month_id \r\n				then month_id - no_of  \r\n				else month_id + no_of\r\nend as period_month_no\r\n,month_name as period_month_name\r\nfrom(\r\n	SELECT current_appraisal_year,\r\n	pm.month_id,\r\n	pm.month_name,\r\n	sc.period_start_month_id,\r\n	case when pm.month_id >= sc.period_start_month_id then 1 else 0 end as m\r\n	FROM period_month pm ,system_config sc\r\n)main\r\nleft join (\r\n	SELECT case when m = 0 then 1 else 0 end as m\r\n	,count(*) as no_of\r\n	from(\r\n		SELECT case when pm.month_id >= sc.period_start_month_id then 1 else 0 end as m\r\n		FROM period_month pm ,system_config sc\r\n	)f\r\n	group by m\r\n)sub on sub.m = main.m\r\nwhere month_id = month(now())\r\n');
