INSERT INTO `r_step_attribute` VALUES ('11933', '18', '510', '0', 'sql', '0', 'SELECT air.item_result_id,\r\nair.emp_result_id,\r\nair.item_id,\r\nair.kpi_type_id,\r\nair.period_id,\r\ner.appraisal_type_id,\r\nap.appraisal_year as year,\r\nmonth(\'${param_start_date}\') as appraisal_month_no,\r\nair.org_id,\r\nair.level_id,\r\nair.emp_id,\r\nair.chief_emp_id,\r\nair.position_id,\r\nCASE \r\n	WHEN SUBSTR(ai.formula_cds_id,2,1) = \"s\" or SUBSTR(ai.formula_cds_id,2,1) = \"a\" THEN (air.target_value/af.frequency_month_value)*(month(\'${param_start_date}\'))\r\n	WHEN SUBSTR(ai.formula_cds_id,2,1) = \"l\" and af.frequency_id = 1 THEN (air.target_value*af.frequency_month_value)\r\n  WHEN SUBSTR(ai.formula_cds_id,2,1) = \"l\" and af.frequency_id != 1 THEN ((air.target_value/af.frequency_month_value)*(TIMESTAMPDIFF(MONTH, ap.start_date, \'${param_start_date}\')+1))\r\nEND as target_value,\r\n-- air.target_value / case when ai.remind_condition_id = 1 then af.frequency_month_value else 4 end as target_value,\r\nkcm.cds_id,\r\nREPLACE(ai.formula_cds_id, \'last\', \'sum\') as formula_cds_id,\r\naf.frequency_month_value,\r\n0 as accum_flag\r\nFROM appraisal_item_result air\r\nINNER JOIN emp_result er on er.emp_result_id = air.emp_result_id\r\ninner join appraisal_item ai on ai.item_id = air.item_id\r\ninner join appraisal_structure astr on astr.structure_id = ai.structure_id\r\ninner join kpi_cds_mapping kcm on kcm.item_id = ai.item_id\r\ninner join appraisal_period ap on ap.period_id = air.period_id\r\ninner join appraisal_frequency af on af.frequency_id = ap.appraisal_frequency_id\r\nwhere air.period_id in (\r\n	SELECT ap.period_id\r\n	FROM appraisal_period ap\r\n	where ap.start_date <= \'${param_start_date}\' and ap.end_date >= \'${param_end_date}\'\r\n	and ap.appraisal_year = (select current_appraisal_year from system_config)\r\n)\r\nand astr.form_id = 1\r\n-- and air.org_id = 1\r\ngroup by air.item_result_id,\r\nair.emp_result_id,\r\ner.appraisal_type_id,\r\nair.item_id,\r\nair.kpi_type_id,\r\nair.period_id,\r\nap.appraisal_year,\r\nair.org_id,\r\nair.level_id,\r\nair.emp_id,\r\nair.chief_emp_id,\r\nair.position_id,\r\nair.target_value / af.frequency_month_value,\r\nkcm.cds_id,\r\nai.formula_cds_id');
